import Card from "./Card";
import products from "./ItemName";
const ShowItem = () => {
  return (
    <>
      <div style={{display: "flex",width:"100%",height:"100%",flexDirection:"row",border: "2px solid red"}}>
        {products.map((val) => {
          return <Card item={val} />;
        })}
      </div>
    </>
  );
};

export default ShowItem;
